import { Col, Row } from "react-bootstrap";
import * as Icon from "react-bootstrap-icons";
import profilePic from "../img/Louis profile .JPG";

const Chat = () => {
  return (
    <Col>
      <Row className="mt-3">
        <div className="inputContainer w-100">
          <Icon.Search className="search-icon" size={20} />
          <input
            type="search"
            placeholder="search user by name"
            className="w-100 pr-1 pl-5 py-2 mr-3 search-field"
          />
        </div>
      </Row>
      <Row>
        <Col className="d-flex justify-content-between mt-4">
          <img src={profilePic} alt="" className="small-profile-img mr-2" />
          <div className="d-flex mr-auto">
            <span>
              <strong>Louis Gadza</strong>
            </span>
            <span>Hi,how can I help you?...</span>
          </div>
          <span>12 min</span>
        </Col>
      </Row>
    </Col>
  );
};
export default Chat;
